tables.table_schema:
CREATE TABLE printing_parameters (
    id INT PRIMARY KEY,
    parameter_name VARCHAR(50),
    parameter_value DECIMAL
);

CREATE TABLE print_quality_metrics (
    id INT PRIMARY KEY,
    metric_name VARCHAR(50),
    target_value DECIMAL,
    actual_value DECIMAL
);

CREATE TABLE printer_logs (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    printer_id INT,
    status VARCHAR(50)
);

CREATE TABLE PrintingParameters (
  printing_parameter_id INT PRIMARY KEY,
  parameter_name VARCHAR(50) NOT NULL,
  parameter_value FLOAT NOT NULL
);

CREATE TABLE PrinterModels (
  printer_model_id INT PRIMARY KEY,
  model_name VARCHAR(50) NOT NULL,
  manufacturer VARCHAR(50) NOT NULL,
  release_year INT
);

CREATE TABLE QualityAssuranceChecks (
  check_id INT PRIMARY KEY,
  log_id INT NOT NULL,
  parameter_value FLOAT NOT NULL,
  quality_pass BOOLEAN NOT NULL
);

CREATE TABLE PrintingMachine (
    machine_id INT PRIMARY KEY,
    machine_name VARCHAR(255),
    location VARCHAR(255),
    maintenance_personnel_id INT
);

CREATE TABLE Personnel (
    personnel_id INT PRIMARY KEY,
    personnel_name VARCHAR(255),
    role VARCHAR(50)
);
